import React, { useState } from 'react';
import MenuElement from './MenuElement.js';
import axios from 'axios';

import './LeftMenu.css';

const LeftMenu = () => {
  const [elements, setElements] = useState();

  const data = axios.get('http://localhost:3001/recipelist')
    .then( (res) => {
      res.map( (r) => <MenuElement onClick={()=>console.log(r.title)} val={r.title} src="placeholder.jpg" key="empty"/>);
    })
    .then( (res) => {
      console.log(res);
      setElements(res)
    });
  
  console.log(data);
  return (
    <div className="menu left">
      <div className="banner">
        Menu
      </div>
      <div className="elements">
        {elements}
      </div>
    </div>
  )
}

export default LeftMenu;
